export const LOGIN_SUCESS = "LOGIN_SUCESS";

 const SET_LOGIN = (userName,UserPass) => {
    return dispatch => {
        dispatch({
            type: LOGIN_SUCESS,
            payload: { userName,UserPass}
          });
    };
  };
